import './App.css';
import SectionHeading from './components/section_heading/section_heading';
import Nav from './components/header/nav.js';
import Summary from './components/summary/summary';
import About from './components/about/about';
import Skills from './components/skills/skills';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Nav/>
      </header>
      <div className='body'>
        <Summary/>
        <SectionHeading describe='a bit' heading='about me'/>
        <About/>
        <SectionHeading describe='some of my' heading='skills'/>
        <Skills/>
        <SectionHeading describe='glance into' heading='my projects'/>
      </div>
    </div>
  );
}

export default App;
